import { useState } from "react";
import "./App.css";

function App() {
  const [value, setValue] = useState(0);
  const [listValue, setList] = useState([]);
  const outputArray = (value) => {
    let list = [];
    for (let i = 1; i <= value; i++) {
      if (i % 5 === 0 && i % 3 === 0) {
        list.push("FizzBuzz");
      } else if (i % 5 === 0) {
        list.push("Fizz");
      } else if (i % 3 === 0) {
        list.push("Buzz");
      } else {
        list.push(String(i));
      }
    }
    setList(list);
  };
  return (
    <div className="App">
      <h3>Enter NU</h3>
      <input onKeyUp={(e) => setValue(Number(e.target.value))} />
      <input type="submit" value="submit" onClick={() => outputArray(value)} />
      <h3>Output</h3>
      <div>
        {listValue.map((each, index) => (
          <p key={index}>{each}</p>
        ))}
      </div>
    </div>
  );
}

export default App;
